import React from 'react';
import {Switch, Route} from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    /*<div className="App">
      <h1>hello</h1>
    </div>*/

    <Switch>
      <Route path="/" components={Home}/>
    </Switch>
  );
}

export default App;
